() => {
  let data = [];
  for (let i = 0; i < SELECT_LEADS_CALLBACK.data.length; i++) {
    if (helper_js.to_date(SELECT_LEADS_CALLBACK.data[i].SCHEDULE_DATE) <= helper_js.get_today_with_minutes()) {
      data.push(SELECT_LEADS_CALLBACK.data[i]);
    }
  }
  if (data.length == 0) {
    for (let i = 0; i < SELECT_LEADS_CALLBACK.data.length; i++) {
      if (SELECT_LEADS_CALLBACK.data[i].SCHEDULE_DATE == "" || !SELECT_LEADS_CALLBACK.data[i].SCHEDULE_DATE) {
        data.push(SELECT_LEADS_CALLBACK.data[i]);
      }
    }
  }
  data.sort((a, b) => {
    return helper_js.to_date(b.SCHEDULE_DATE) - helper_js.to_date(a.SCHEDULE_DATE);
  });
  console.log();
  return data;
}

